INSERT INTO `field_revision_body` VALUES ('node','goodhelp_topic',0,1,1,'und',0,'COLUMBIA SCE SPECIFIC STUFF Nodes are your friend. Did you know that a node in Drupal is just like your favorite puppy dog? It\'s got a tail, and a big loveable smile that sits waiting to greet you at the bootstrap. Just don\'t forget to feed them after midnight. BOO! Nodes are your friend. Did you know that a node in Drupal is just like your favorite puppy dog? It\'s got a tail, and a big loveable smile that sits waiting to greet you at the bootstrap. Just don\'t forget to feed them after midnight. BOO!','','plain_text'),('node','goodhelp_topic',0,2,2,'und',0,'ASU SPECIFIC STUFF Corned beef t-bone beef, bresaola brisket jowl tri-tip prosciutto bacon boudin pork belly jerky tongue pork chop. Venison flank pig sirloin leberkäse cow strip steak boudin, corned beef ribeye t-bone turkey. Boudin t-bone pig kielbasa tail swine. Bacon brisket beef, pork sirloin swine bresaola t-bone tail pig pork loin flank prosciutto. Tri-tip tenderloin rump, chicken ribeye salami strip steak frankfurter ground round meatball drumstick andouille sirloin turducken. Chicken sausage flank, kielbasa shankle drumstick fatback frankfurter tri-tip. Tail ground round meatball pancetta.\r\n\r\nChicken pork strip steak spare ribs frankfurter, brisket cow chuck venison bacon biltong fatback short loin. Turkey tail filet mignon, boudin kielbasa turducken pastrami hamburger ham hock short loin beef chuck shoulder fatback tenderloin. Fatback t-bone ball tip, ribeye tenderloin ground round sausage. Shoulder short loin ball tip, tri-tip pork belly shankle sirloin flank meatball beef chicken pork pig sausage. Shankle shoulder tri-tip, strip steak spare ribs kielbasa filet mignon cow meatball short ribs fatback brisket shank biltong ground round. Pancetta bacon cow, ham bresaola sirloin fatback turducken ham hock pork loin pig chuck tenderloin ground round. Flank ball tip biltong capicola prosciutto, shoulder meatball sirloin.','','plain_text'),('node','goodhelp_topic',0,3,3,'und',0,'There once was a man who had a plan, panama! it was so cool and neat that he had to make full sentences about the thing that made him go, but he stopped and said no. I\'ll be waiting with a gun and a pack of sammiches, and nothing. And nothing. Nothing.','','plain_text'),('node','goodhelp_topic',0,4,4,'und',0,'<p>NON-SPECIFIC ALL SITES STUFF Nodes are your friend. Did you know that a node in Drupal is just like your favorite puppy dog? It&#39;s got a tail, and a big loveable smile that sits waiting to greet you at the bootstrap. Just don&#39;t forget to feed them after midnight. BOO! Nodes are your friend. Did you know that a node in Drupal is just like your favorite puppy dog? It&#39;s got a tail, and a big loveable smile that sits waiting to greet you at the bootstrap. Just don&#39;t forget to feed them after midnight. BOO!</p>','','wysiwyg_html');
